import React from "react";
import Layout from "../components/Layout";
import Header from "../components/Header";
import TopImage from "../components/TopImage";
import Footer from "../components/Footer";

const layoutStyle = {
  margin: 0,
  background: "beige",
  fontFamily: "YuMincho",
  letterSpacing: 3,
  fontWeight: 300,
  fontColor: "lightgray",
};

export default () => (
  <div>
    <Layout style={layoutStyle} title="WINE手帳" />
    <Header />
    <TopImage />
    <Footer />
  </div>
);
